import React from "react";
import TimeStyle from "./TimeStyle"
import styled from 'styled-components'


const TimeContainer = styled.div`
    position: relative;
	margin: 0 0.25rem;
	height: 7rem;
	background: #4e4e4e;
`;

const TimeLable = styled.span`
    width: 6rem;
	height: 5rem;
	font-weight: 300;
	display: flex;
	justify-content: center;
	align-items: center;
	font-size: 3rem;
	z-index: 10;
`;

const TimeValue = styled(TimeLable)`
    width: 6rem;
	height: 5rem;
	font-weight: 300;
	display: flex;
	justify-content: center;
	align-items: center;
	font-size: 3rem;
	z-index: 10;
`;


class Time extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          time: props.time,
        };
      }


      render() {
        const strTimeObj = timeFormatter(this.state.time);
        return (
           <TimeStyle>
               <TimeContainer>
				<TimeValue>{strTimeObj.days}</TimeValue>
				<TimeLable>Days</TimeLable>
			</TimeContainer>
			<TimeContainer>
				<TimeValue>{strTimeObj.hours}</TimeValue>
				<TimeLable>Hours</TimeLable>
			</TimeContainer>
			<TimeContainer>
				<TimeValue>
					{strTimeObj.minutes}
				</TimeValue>
				<TimeLable>Minutes</TimeLable>
			</TimeContainer>
			<TimeContainer>
				<TimeValue>
					{strTimeObj.seconds}
				</TimeValue>
				<TimeLable>Seconds</TimeLable>
			</TimeContainer>
           </TimeStyle>
        )
      }
}


export default Time;
